"use strict";

const BinaryStoreError = require("./binarystore-error.js");

class SobExceeded extends BinaryStoreError {
  constructor(cause, message) {
    super(message || "Size of uuBinary data exceeded.", cause);
    this.code = `${BinaryStoreError.ERROR_PREFIX}sobExceeded`;
  }
}

module.exports = SobExceeded;
